A '''Bronze Chest''' with brown locks can be found in the [[Shade Catacombs]] during the [[Shades of Mort'ton (minigame)|Shades of Mort'ton]] [[minigame]]. A [[bronze key brown]] is needed to open the chest, after which the key dissolves.

